// SPDX-License-Identifier: MIT

pragma solidity ^0.8.27;

interface IProposalVote {
    enum PropsStatus {
        None,
        Created,
        Pending,
        Accepted
    }

    struct Proposal {
        string name;
        string description;
        uint16 voteCount;
        address[] voters;
        uint16 quorum;
        PropsStatus status;
    }

    function createProposal(
        string memory _name,
        string memory _desc,
        uint16 _quorum
    ) external;

    function voteOnProposal(uint8 _index) external;

    function getAllProposals() external view returns (Proposal[] memory);

    function getAProposal(uint8 _index)
        external
        view
        returns (
            string memory name_,
            string memory desc_,
            uint16 count_,
            address[] memory voters_,
            uint16 quorum_,
            PropsStatus status_
        );
}

contracts/Lock.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.27;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

contract Lock {
    uint public unlockTime;
    address payable public owner;

    event Withdrawal(uint amount, uint when);

    constructor(uint _unlockTime) payable {
        require(
            block.timestamp < _unlockTime,
            "Unlock time should be in the future"
        );

        unlockTime = _unlockTime;
        owner = payable(msg.sender);
    }

    function withdraw() public {
        // Uncomment this line, and the import of "hardhat/console.sol", to print a log in your terminal
        // console.log("Unlock time is %o and block timestamp is %o", unlockTime, block.timestamp);

        require(block.timestamp >= unlockTime, "You can't withdraw yet");
        require(msg.sender == owner, "You aren't the owner");

        emit Withdrawal(address(this).balance, block.timestamp);

        owner.transfer(address(this).balance);
    }
}

contracts/ProposalVote.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

contract ProposalVote {
    enum PropsStatus {
        None,
        Created,
        Pending,
        Accepted
    }

    struct Proposal {
        string name;
        string description;
        uint16 voteCount;
        address[] voters;
        uint16 quorum;
        PropsStatus status;
    }

    mapping(address => mapping(uint8 => bool)) hasVoted;

    Proposal[] public proposals;

    //events
    event ProposalCreated(string indexed name, uint16 quorum);
    event ProposalApproved(string indexed name, uint16 count);
    event ProposalActive(string indexed name, uint16 count);

    function createProposal(
        string memory _name,
        string memory _desc,
        uint16 _quorum
    ) external {
        require(msg.sender != address(0), "Zero address is not allowd");
        Proposal memory newProposal;
        newProposal.name = _name;
        newProposal.description = _desc;
        newProposal.quorum = _quorum;
        newProposal.status = PropsStatus.Created;

        proposals.push(newProposal);

        emit ProposalCreated(_name, _quorum);
    }

    function voteOnProposal(uint8 _index) external {
        require(msg.sender != address(0), "Zero address is not allowed");
        require(_index < proposals.length, "Index is out-of-bound");
        require(!hasVoted[msg.sender][_index], "You've voted already");

        Proposal storage currentProposal = proposals[_index];

        require(
            currentProposal.status != PropsStatus.Accepted,
            "This proposal has been accepted already"
        );
        currentProposal.voteCount += 1;
        currentProposal.voters.push(msg.sender);
        currentProposal.status = PropsStatus.Pending;

        hasVoted[msg.sender][_index] = true;

        if (currentProposal.voteCount >= currentProposal.quorum) {
            currentProposal.status = PropsStatus.Accepted;

            emit ProposalApproved(
                currentProposal.name,
                currentProposal.voteCount
            );
        } else {
            emit ProposalActive(
                currentProposal.name,
                currentProposal.voteCount
            );
        }
    }

    function getAllProposals() external view returns (Proposal[] memory) {
        return proposals;
    }

    function getAProposal(
        uint8 _index
    )
        external
        view
        returns (
            string memory name_,
            string memory desc_,
            uint16 count_,
            address[] memory voters_,
            uint16 quorum_,
            PropsStatus status_
        )
    {
        require(msg.sender != address(0), "Zero address is not allowed");
        require(_index < proposals.length, "Index is out-of-bound");

        Proposal memory currentProposal = proposals[_index];
        name_ = currentProposal.name;
        desc_ = currentProposal.description;
        count_ = currentProposal.voteCount;
        voters_ = currentProposal.voters;
        quorum_ = currentProposal.quorum;
        status_ = currentProposal.status;
    }
}

contracts/ProposalVoteFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.27;

import {ProposalVote} from "./ProposalVote.sol";
import {IProposalVote} from "./IProposalVote.sol";

contract ProposalVoteFactory {
    struct DeployedContractInfo {
        address deployer;
        address deployedContract;
        uint256 timestamp;
    }

    event ProposalVoteDeployed(address indexed deployer, address indexed contractAddress);
    event ProposalCreated(address indexed contractAddress, string name, uint16 quorum);
    event VoteCast(address indexed contractAddress, address indexed voter, uint8 proposalIndex);

    DeployedContractInfo[] public allContracts;
    mapping(address => DeployedContractInfo[]) public userDeployedContracts;

    modifier validAddress(address _addr) {
        require(_addr != address(0), "Invalid address");
        _;
    }

    modifier validContract(address _contractAddr) {
        bool isValid = false;
        for (uint i = 0; i < allContracts.length; i++) {
            if (allContracts[i].deployedContract == _contractAddr) {
                isValid = true;
                break;
            }
        }
        require(isValid, "Contract not found");
        _;
    }

    function deployProposalVote() external validAddress(msg.sender) returns (address) {
        ProposalVote newContract = new ProposalVote();
        address contractAddress = address(newContract);

        DeployedContractInfo memory contractInfo = DeployedContractInfo({
            deployer: msg.sender,
            deployedContract: contractAddress,
            timestamp: block.timestamp
        });

        allContracts.push(contractInfo);
        userDeployedContracts[msg.sender].push(contractInfo);

        emit ProposalVoteDeployed(msg.sender, contractAddress);
        return contractAddress;
    }

    function createProposal(
        address _contractAddr,
        string memory _name,
        string memory _desc,
        uint16 _quorum
    ) external validAddress(msg.sender) validContract(_contractAddr) {
        IProposalVote(_contractAddr).createProposal(_name, _desc, _quorum);
        emit ProposalCreated(_contractAddr, _name, _quorum);
    }

    function voteOnProposal(address _contractAddr, uint8 _index) 
        external 
        validAddress(msg.sender) 
        validContract(_contractAddr) 
    {
        IProposalVote(_contractAddr).voteOnProposal(_index);
        emit VoteCast(_contractAddr, msg.sender, _index);
    }

    function getProposalDetails(address _contractAddr, uint8 _index)
        external
        view
        validAddress(msg.sender)
        validContract(_contractAddr)
        returns (
            string memory name_,
            string memory desc_,
            uint16 count_,
            address[] memory voters_,
            uint16 quorum_,
            IProposalVote.PropsStatus status_
        )
    {
        return IProposalVote(_contractAddr).getAProposal(_index);
    }

    function getAllProposals(address _contractAddr)
        external
        view
        validAddress(msg.sender)
        validContract(_contractAddr)
        returns (IProposalVote.Proposal[] memory)
    {
        return IProposalVote(_contractAddr).getAllProposals();
    }

    function getAllDeployedContracts() external view returns (DeployedContractInfo[] memory) {
        return allContracts;
    }

    function getUserDeployedContracts(address _user) 
        external 
        view 
        validAddress(_user) 
        returns (DeployedContractInfo[] memory) 
    {
        return userDeployedContracts[_user];
    }

    function getContractCount() external view returns (uint256) {
        return allContracts.length;
    }
}

